import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isUserMenuOpen, setIsUserMenuOpen] = useState(false);
  const location = useLocation();

  // Check if user is logged in (in a real app, this would use authentication)
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const toggleUserMenu = () => {
    setIsUserMenuOpen(!isUserMenuOpen);
  };

  const handleLogin = () => {
    // In a real app, this would open a login modal or redirect to login page
    setIsLoggedIn(true);
  };

  const handleLogout = () => {
    // In a real app, this would handle logout logic
    setIsLoggedIn(false);
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          <span className="logo-text">CodeArena</span>
        </Link>

        <div className="menu-icon" onClick={toggleMenu}>
          <i className={isMenuOpen ? 'fas fa-times' : 'fas fa-bars'} />
        </div>

        <ul className={isMenuOpen ? 'nav-menu active' : 'nav-menu'}>
          <li className="nav-item">
            <Link 
              to="/" 
              className={`nav-link ${location.pathname === '/' ? 'active' : ''}`}
              onClick={() => setIsMenuOpen(false)}
            >
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link 
              to="/battles" 
              className={`nav-link ${location.pathname === '/battles' ? 'active' : ''}`}
              onClick={() => setIsMenuOpen(false)}
            >
              Coding Battles
            </Link>
          </li>
          <li className="nav-item">
            <Link 
              to="/learning" 
              className={`nav-link ${location.pathname === '/learning' ? 'active' : ''}`}
              onClick={() => setIsMenuOpen(false)}
            >
              Learning Paths
            </Link>
          </li>
          <li className="nav-item">
            <Link 
              to="/achievements" 
              className={`nav-link ${location.pathname === '/achievements' ? 'active' : ''}`}
              onClick={() => setIsMenuOpen(false)}
            >
              Achievements
            </Link>
          </li>
          <li className="nav-item">
            <Link 
              to="/jobs" 
              className={`nav-link ${location.pathname === '/jobs' ? 'active' : ''}`}
              onClick={() => setIsMenuOpen(false)}
            >
              Job Board
            </Link>
          </li>
        </ul>

        <div className="auth-buttons">
          {isLoggedIn ? (
            <div className="user-profile">
              <div className="profile-icon" onClick={toggleUserMenu}>
                <img 
                  src="https://randomuser.me/api/portraits/men/32.jpg" 
                  alt="Profile" 
                  className="profile-image"
                />
              </div>
              {isUserMenuOpen && (
                <div className="user-dropdown">
                  <Link to="/profile" className="dropdown-item" onClick={() => setIsUserMenuOpen(false)}>
                    My Profile
                  </Link>
                  <Link to="/settings" className="dropdown-item" onClick={() => setIsUserMenuOpen(false)}>
                    Settings
                  </Link>
                  <div className="dropdown-divider"></div>
                  <button className="dropdown-item logout" onClick={handleLogout}>
                    Log Out
                  </button>
                </div>
              )}
            </div>
          ) : (
            <>
              <button className="login-button" onClick={handleLogin}>
                Log In
              </button>
              <Link to="/signup" className="signup-button">
                Sign Up
              </Link>
            </>
          )}
        </div>
      </div>

      {/* Practice Mode Button in Navbar */}
      {location.pathname === '/battles' && (
        <Link to="/battles" className="practice-mode-nav-button">
          üèãÔ∏è Practice Mode
        </Link>
      )}
    </nav>
  );
}

export default Navbar;
